import React from 'react';
import styled from 'styled-components';

const Card = styled.div`
  background: white;
  padding: 20px;
  border-radius: 10px;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
`;

const Title = styled.h2`
  font-size: 1.5rem;
  margin-bottom: 10px;
`;

const Content = styled.p`
  font-size: 1rem;
  color: #666;
`;

const MetaInfo = styled.div`
  font-size: 0.875rem;
  color: #999;
`;

const PostCard = ({ title, likes, author, date, content, country, continent }) => {
  return (
    <Card>
      <Title>{title}</Title>
      <MetaInfo>{date} by {author || "Anonymous"}</MetaInfo>
      <Content>{content}</Content>
      <MetaInfo>Likes: {likes}</MetaInfo>
      <MetaInfo>Country: {country}, Continent: {continent}</MetaInfo>
    </Card>
  );
};

export default PostCard;
